import React, { useState } from "react";
import { Link } from "react-router-dom";
import { Navigation, LogoFade, LinkBlack } from "../styles/navbar_style";

import Logo from "../images/Logo-Placeholder.png";
import {
  Collapse,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
} from "reactstrap";

const Navibar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

  const history = useHistory();
  const route1 = () => {
    history.push("/about_our_mission");
  };
  const route2 = () => {
    history.push("/main");
  };
  const route3 = () => {
    history.push("/about_us");
  };

  return (
    <Navigation light expand="md">
      <NavbarToggler onClick={toggle} />
      <Collapse isOpen={isOpen} navbar>
        <Nav
          className="mr-auto"
          navbar
          style={{
            width: "100%",
            textAlign: "center",
            display: "flex",
            alignContent: "center",
          }}
        >
          <UncontrolledDropdown nav inNavbar style={{ width: "90%" }}>
            <DropdownToggle nav style={{ color: "black" }}>
              <LinkBlack>Menus</LinkBlack>
            </DropdownToggle>
            <DropdownMenu left>
              <DropdownItem>Chef's Choice</DropdownItem>
              <DropdownItem>Keto</DropdownItem>
              <DropdownItem>Build A Meal</DropdownItem>
            </DropdownMenu>
          </UncontrolledDropdown>

          <NavItem style={{ display: "flex", alignContent: "center" }}>
            <LinkBlack
              style={{ color: "gray", justifyContent: "center" }}
              target="_blank"
              rel="noopener noreferrer"
              href="https://www.yourblackfriend.org/"
            >
              Your Black Friend
            </LinkBlack>
          </NavItem>

          <UncontrolledDropdown nav inNavbar style={{ width: "100%" }}>
            <DropdownToggle nav style={{ color: "black" }}>
              <LinkBlack> Let's Discuss</LinkBlack>
            </DropdownToggle>
            <DropdownMenu right>
              <DropdownItem>Video Conversations</DropdownItem>
              <DropdownItem>Ask Advice</DropdownItem>
            </DropdownMenu>
          </UncontrolledDropdown>

          <UncontrolledDropdown nav inNavbar style={{ width: "100%" }}>
            <DropdownToggle nav style={{ color: "black" }}>
              <LinkBlack> Who We Are</LinkBlack>
            </DropdownToggle>
            <DropdownMenu right>
              <DropdownItem onClick={route1}>
                Vision &amp; Mission Statement
              </DropdownItem>
              <DropdownItem onClick={route3}>
                The Humans Behind HUEmanistic
              </DropdownItem>
            </DropdownMenu>
          </UncontrolledDropdown>

          <UncontrolledDropdown nav inNavbar style={{ width: "100%" }}>
            <DropdownToggle nav style={{ color: "black" }}>
              <LinkBlack>Get Involved</LinkBlack>
            </DropdownToggle>
            <DropdownMenu left>
              <DropdownItem>Volunteer</DropdownItem>
              <DropdownItem>Donate</DropdownItem>
            </DropdownMenu>
          </UncontrolledDropdown>
        </Nav>
      </Collapse>
    </Navigation>
  );
};

export default Navibar;
